// 페이지가 아닌 컴포넌트는 components 폴더에! (이건 필수는 아님)

import PropTypes from "prop-types";

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>공통 메뉴</div>
      {children}
    </div>
  );
};

// 타입은 노드인데, 여기서 노드는 return 부에 들어갈 수 있는 모든 것을 의미한다.
// 타입 스크립트 대용인 듯
AppLayout.prototype = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
